            {name: 'John', age: 35}
        ]
    }

    render() {
        return(
            <div>
                <h1>React</h1>
                <Person name={this.state.persons[0].name} age={this.state.persons[0].age}>
                    hobbie: chess
                </Person>
                <Person name={this.state.persons[0].name} age={this.state.persons[1].age}/>
            </div>
        );
    }
}

export default App;
